import logo from '../images/logo.svg';
import '../App.css';
import './Home.css';

export default function Home() {
  return (
    <div className="App">
    <header className="App-header">
      <img src={logo} className="App-logo" alt="logo" />
      <p>Hi, I'm Cathy, UI UX Designer in Toronto.</p>
    </header>
  </div>
  );
}
